import React, {useEffect} from "react";
import styled from "styled-components";

import StopWatch from "../timers/Stopwatch";



const Container = styled.div`
  display: flex;
  justify-content: center;
  width: 100%;
`;

const Body = styled.div`
  border: 1px solid gray;
  padding: 20px;
  margin: 10px;
  font-size: 1.5rem;
  width: 500px;
  text-align: center;
  background-color: lightgrey;
  border-radius: 3%;
`;



const AddView = () => {
  const timers = [
    { title: "Stopwatch", C: <Stopwatch />},
    { title: "Countdown", C: <Countdown />}, 
    { title: "XY", C: <XY />},
    { title: "Tabata", C: <Tabata />},
  ];

  useEffect(() => {
    document.title = "Susana T. - Assignment 2 - Timers";  
  }, []);

  return (
    <Container>
        <Body>
            <div>
              {
                timers.map((t,i) => (
                  <button>t.title </button>
                ))
              }
            </div>


            <div>Stopwatch <button>Add StopWatch</button></div>
            <div>Countdown <button>Add Countdown</button></div>
            <div><button>Add XY</button></div>
            <div><button>Add Tabata</button></div>
        </Body>

    </Container>
  );
};

export default AddView;
